import pruebavideo from '../../assets/Video/pruebavideo.mp4';
import styles from './Video.module.css'

const Video = () => {
    return (
        <video className={styles} autoPlay loop muted id='video'>
            <source src={pruebavideo} type='video/mp4'/>
        </video>
    )
}

export default Video;
